import React from 'react'

//import Maapform from './RangeCircleform'
export default function Home() {
    return (
        <div>
            <div className="row">
                <div className="col-lg-8 col-md-8 col-sm-8 col-xs-8 " style={{ background: "blue", width: "100%" }} className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <h2 style={align="center"}>E-Learning</h2>
                </div>
                <div className="col-lg-4 col-md-4 col-sm-4 col-xs-4">
            <button type="submit" >Login </button></div> 
            </div>
          

        </div>
    )
}
